import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import React, { useState, useEffect } from "react";
import WeekBarGraph from './WeekBarGraph';
import ThirtyDaysMonthBarGraph from './ThirtyDaysMonthBarGraph';
import ThirtyOneDaysMonthBarGraph from './ThirtyOneDaysMonthBarGraph';
import FebLeapMonthBarGraph from './FebLeapMonthBarGraph';
import FebMonthBarGraph from './FebMonthBarGraph';
import TaskMeter from './TaskMeter';
import TimeSelect from './TimeSelect';
// import { Bar } from 'react-chartjs-2';

function Dashbaord(props) {

    return (<div>
        <div className="col1">

            <div className="profileheading">Dashboard</div> 

            <div className='col-lg-8 col-md-8 col-sm-8'><div className="timeselect"><TimeSelect/></div></div>
            <button>Login</button>
            <div className='col-lg-8 col-md-8 col-sm-8'><button onClick={() => props.setStatus(false)} className = "swapbtn">Login</button></div>

            <div className="row1"> 
            <div className='col-lg-8 col-md-8 col-sm-8'><div className="bargraphdiv"><WeekBarGraph/></div></div>

            <div className='col-lg-4 col-md-4 col-sm-4'><div className="taskmeterdiv" style={{fontSize: 21, textAlign: 'center', color: 'white',    }}><TaskMeter label="Bugs fixed" value={25}/></div></div>
            </div>  

        </div>     

       </div>);
}

export default Dashbaord;
